import './index.css'

function Cards(props){
    return(
        <>
        <div className="card">
            <h1 className="header">{props.sname}</h1>
            <img src={props.pic} alt="Image here" />
            <a href="">
                <button>Watch Now</button>
            </a>
        </div>
        </>
    )
}
export default Cards;
